    comment:
      author_association: OWNER
      body: "Hi @dontbanmeplz, you can see the usage in [wiki](https://github.com/beiyuouo/hcaptcha-model-factory/wiki).\
        \ Sorry for my English, if anything you cannot understand, you are welcome\
        \ to give your suggestion.\r\n\r\nAnswer:\r\n1. install requirements, label\
        \ data, change task_name in `config.py`, run the command `python main.py --split\
        \ --mode trainval`\r\n2. You only need to modify the `object.yaml` in `hcaptcha-challenger`.\
        \ For contributing to `hcaptcha-challenger`, you can upload your onnx model\
        \ to [gofile](https://gofile.io/) and open a pull request to  modify `object.yaml`\
        \ with model accuracy and the number of pictures collected.\r\n3. See in [wiki](https://github.com/beiyuouo/hcaptcha-model-factory/wiki).\
        \ `python main.py --mode val`"
